import React from "react"
import YouTube from 'react-youtube';

class MyProjects {
    render() {
        const opts = {
            height: '390',
            width: '640',
            playerVars: {
                // https://developers.google.com/youtube/player_parameters
                autoplay: 1,
            },
        };
        return (
            <div className="myProjects">
                <h1>My Projects</h1>

            </div>
        )
    }
}

export default MyProjects
